import React from "react"

function Project(props){

    console.log(props.project.tools)
    let tools = props.project.tools

    const skills = tools.map(function(skill){
        return <li>
            {skill}
        </li>
    });

    const image = require("../portfolio_assets/FixGradKappa2.png")
    if(props.pos == "l"){
        return(
            <div className={props.container}>
                <img src={image} alt="img" className={props.icon}></img>
                <article>
                    <h2 className={props.h2}>{props.project.caption}</h2>
                    <p className={props.p}>{props.project.text}</p>
                    <br></br><br></br>
                    <ul className={props.ul}>
                        {skills}
                    </ul>
                </article>
                <p></p>
            </div>
        )
    }
    else{
        return(
            <div className={props.container}>
                <p></p>
                <article>
                    <h2 className={props.h2}>{props.project.caption}</h2>
                    <p className={props.p}>{props.project.text}</p>
                    <br></br><br></br>
                    <ul className={props.ul}>
                        {skills}
                    </ul>
                </article>
                <img src={image} alt="img" className={props.icon}></img>
            </div>
        )
    }
}

export default Project
